import React from "react";
import { Doughnut } from "react-chartjs-2";

const data = {
    labels: ['red', 'blue']
}


const BarChart = () => {
    return <div>
        <h1>Chart</h1>
        <Doughnut data={data}/>
    </div>
}

export default BarChart
